import React from "react";
import { Container, Row, Col, Button } from "react-bootstrap";
import "./Miasta.css";
import miastoImage from "../assets/miasto.jpg";  // zakładam, że masz taki obraz w assets

const Miasta = () => {
  const miasta = [
    "Warszawa",
    "Kraków",
    "Gdańsk",
    "Wrocław",
    "Poznań",
    "Rzeszów",
  ];

  return (
    <Container fluid className="miastaBackground">
      <Row className="my-4">
        <Col>
          <img src={miastoImage} alt="Miasta" className="img-fluid" />
        </Col>
      </Row>
      <Row>
        {miasta.map((miasto, index) => (
          <Col key={index} md={4} className="my-2">
            <Button
              variant="primary"
              className="w-100"
              href={`/ogloszenia/${miasto.toLowerCase()}`}
            >
              {miasto}
            </Button>
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default Miasta;
